var tipuesearch = {"pages": [{'title': 'About', 'text': '黃翊銘的網站 \n 黃翊銘的倉儲 \n 陳冠宇的網站 \n 陳冠宇的倉儲 \n stage ag22 的網站 \n stage ag22 的倉儲 \n 產品主題 \n "多功能變型家具" \n 設計理念 \n 由於現在台灣地價飆漲，百姓的生活空間受到壓迫，為了最大限度的節省空間，我們才想說做一個可以變形並且方便收納的多功能變形家具 \n 我們最後選擇將椅子和桌子融合在一起，因為對於大學生來說要租到一間便宜，空間又大的房間，是可遇不可求的，魚和熊掌不可兼得的道理，基本上很難能兩全其美，所以既然空間不夠，那就將不必要的物品收起來，經過我們調查，很多時候我們其實只用的到一樣東西，不會同時需要使用，所以當今天有同學來家裡聊天就可以搬出我們設計的這款多功能變型家具，變成椅子讓客人坐，要是要做學術討論，將椅子變桌子一起討論，要是不用時又可以變成裝置藝術，簡直是一舉三得的好產品阿~~~(✿◕‿◕✿) \n \n 還不快來贊助我們!!! \n \n \n \n', 'tags': '', 'url': 'About.html'}, {'title': '製作過程', 'text': '第一次大改版 \n \n', 'tags': '', 'url': '製作過程.html'}, {'title': 'week2', 'text': '第一次的產品設計。 \n 本次設計的理念最主要是以 實用 為主，其次為 可行性 。因此往傢俱的方向去構思 \n 似乎是個不錯的想法？ \n 最近看到摺疊傢俱豐富多變，設計一個具備兩種功能的傢俱，以實用性來說非常不錯。 \n 一開始用google meeting討論雛形，組員各自畫出自己的想法，將想法合併，探討其 \n 中是否存在衝突或是錯誤。 \n \n \n 我們的想法是:把一張椅子變形成桌子，藉由摺疊的方式，自由變換型態。 \n 中間遇到最大的問題是桌面的拼接方式以及中間的接合處間隙，我們從5種拼接方式中選擇 \n 最合適且最好設計的形狀(在第三周顯示)，再來設計尺寸。 \n', 'tags': '', 'url': 'week2.html'}, {'title': 'week3', 'text': '\n', 'tags': '', 'url': 'week3.html'}, {'title': 'week4', 'text': '', 'tags': '', 'url': 'week4.html'}]};